$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_cd1803581af8ed1e0857a635845a6f62'] = 'Cena s DPH jako desetinné číslo (např. \"25.50\")';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_2b2a7f2ee73680e7076d3fa9c20148bf'] = 'Cena s DPH jako desetinné číslo, včetně zkratky měny (např. \"25.50 Kč\")';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_e890d5aca32cdcaf88caf2fb328cb38c'] = 'Cena s DPH jako desetinné číslo, včetně zkratky měny podle ISO-4217 (např. \"25.50 CZK\")';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_9bc9c69757df7b49715da0a7e2c0ec63'] = 'Jestli je produkt dostupný jen v eshopu (= 1), nebo i v kamenné prodejně (= 0).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_1aacaa11429bcea0d2e31905d3599be9'] = 'Datum a čas (v GMT), kdy byl produkt naposled změněn. Výchozí formát je pro Atom 1.0 (např. \"2012-12-08T14:29:57+00:00\"), ale můžete zvolit vlastní (význam jednotlivých znaků viz PHP funkce date). Příklad vlastního formátu:';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_e424774a5916e074212dc627e193d89e'] = 'Datum a čas, kdy byl feed vytvořen (v GMT). Stejně jako u předchozího můžete použít vlastní formát.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_72ebe7adff8cd643742c1788f1b2a2b7'] = 'Kód jazyka, v němž je tento feed (např. \"en-us\" pro americkou angličtinu).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_3b754cdee0c6513e0090a0bad9d9db9b'] = 'Dvoupísmenový kód jazyka podle ISO 639-1 (např. \"en\" pro angličtinu).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_8e8e6e248d40d788f7e9af05956216bc'] = 'Poznámka ke speciálním znakům';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_ec7d5a909f9fc8ee7a4189405f751691'] = 'Ze všech exportovaných dat se automaticky odstraňují HTML značky a speciální znaky (např. ostré závorky nebo &) se převádějí na HTML entity.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_ee8f1c8ed585b5625b0e8df2c0de81a2'] = 'Toto chování lze v Pro verzi změnit podle vašich požadavků.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_808aaaa33716529eb7c9f658ff4a15b5'] = 'Dostupnost produktů';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_14f7610283b9ee1ab47a46ad9c231489'] = 'Pro dostupnost produktů máte k dispozici dvě proměnné: \"days\" a \"availability\". Obě se řídí tím, jestli je produkt skladem a jestli je dostupný pro objednávky (viz nastavení \"Dostupné pro objednávky\" na kartě Informace u editace produktu). Jestli jste u produktu zadali text, který se zobrazuje ve vašem obchodě (front office) podle toho, jestli produkt je / není skladem / lze objednat (viz karta Množství), mohou použít hodnoty z těchto textů. \"Days\" má jednodušší zpracování, použije se první číslo, které najde. Proměnná \"availability\" umí rozlišovat čísla (počet dní pro dodání) a data (např. od kdy bude produkt dostupný). Také si můžete nastavit různé vlastní hodnoty pro dostupnost, např. skladem / na objednávku / vyprodáno.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_65d1800737b0167fcb470907fc3c0b91'] = 'Pokud je produkt skladem, vloží do feedu buď první číslo z textu, který se zobrazuje ve vašem obchodě u produktů skladem nebo nulu. Pokud produkt není skladem a u produktu jste nenastavili žádný text, nevrátí žádnou hodnotu. Potom záleží na nastavení tohoto feedu, jestli v XML smí být prázdný tag nebo ne.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_f6073a955c77cf3c8376d37aa8ccb496'] = 'Tato proměnná umožňuje, podobně jako {condition}, zadat různé vlastní hodnoty. Výchozí funkčnost je tato: u produktů, které jsou skladem, vloží stejné číslo jako {days}. Totéž u produktů, které nejsou skladem, ale je možné je objednat. Nedostupné produkty se do feedu vůbec nevloží.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_5e95660d8f89d53e778c2be9e7dc0c78'] = 'Možnosti přizpůsobení: vlastní hodnoty se zadávají v pořadí \"skladem\", \"na objednávku\" a \"vyprodané\". Neměly by ale začínat mřížkou, ta je vyhrazena pro speciální hodnoty. Za čárkami můžete pro lepší čitelnost nechávat mezery.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_fd05d7f6bfc90e815087880e8e915b43'] = 'Příklady:';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_8d5373cfcd25d53d49529403e0f5b94f'] = 'U produktů, které jsou na skladě, se do feedu vloží \"in stock\". Další dvě hodnoty jsou pro zboží, které není skladem. Pokud je povolené objednávání zboží, které není skladem, použije se druhá hodnota (\"on order\"). Pokud není povolené ho objednávat, a zároveň je zadaná třetí hodnota, použije se třetí hodnota (\"sold out\"). Pokud není povolené objednávat produkt a třetí hodnota chybí, položka se vůbec neexportuje.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_2c4261d887578ef5095a1e4817beaa4f'] = 'Vloží se zadané texty, do feedu se přidají i nedostupné produkty.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_608310cd01dadb86e4f25b460d27c0a0'] = 'U produktů skladem se vloží číslo. U produktů na objednávku buď číslo, anebo datum zformátované podle zadání (viz PHP funkce date). Výchozí chování pro nedostupné produkty se nebude měnit, takže jej lze vynechat.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_0642848367ccb9190d7d9de721991265'] = 'Pokud chcete u produktů skladem ještě rozlišovat podle dodací lhůty, zadejte počet dní, hodnotu pokud je dostupnost menší nebo rovna počtu dní a hodnotu pro pozdější dostupnost, oddělujte dvojtečkou. Podle tohoto příkladu se u produktů skladem, které budou odeslány do tří dnů vloží hodnota \"immediately\" (ihned), u ostatních produktů skladem se vloží \"expected product\" (očekávany produkt). U produktů na objednávku se vloží číslo/datum.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_e5472aea187bb18cb4ef76fe839b34db'] = 'U produktů se stavem \"in stock\", je zadán počet výrobků. Produkty se stavem \"on the way\", se vloží číslo nebo datum. Nedostupné produkty nejsou vůbec přidány do feedu (to je výchozí nastavení).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_d2485422084f95b260b683798d114bc8'] = 'Nastavení pro Nákupy Google (Google Merchant Center): U produktů, které budou odeslány do tří dnů včetně, se vloží \"in stock\", u ostatních produktů skladem \"available for order\". U produktů, které nejsou skladem, ale jsou povoleny objednávky, se vloží \"preorder\". U nedostupných produktů se vloží \"out of stock\".';
